import Link from 'next/link';


const Header = () => (
  <div class='nav' >
    <Link href="/">
      <a>Home</a>
    </Link>
    <Link href="/about">
      <a>About</a>
    </Link>


      <style jsx>{`
      	.nav {
      		height: 200px;
      		background-color: blue;
      	}

        a {
        	margin-right: 15px;

        }


      `}</style>
  </div>



);

export default Header;
